import React from 'react';

function RecipeDisplay({queryData}) {
	let recipes = [];
	
	function makeRecipeDisplay(label, image, url, key) {
		return (
			<img src={image} rounded alt={label}/>
		)
		return(
			<div key={key}>
				{label}
				<br></br>
				<img src={image} alt={label}/>
				<br></br>
				{url}
			</div>
		)
	}

	if(queryData) {
		for(let i = 0; i < queryData.hits.length; i++) {
			recipes.push(makeRecipeDisplay(queryData.hits[i].recipe.label, queryData.hits[i].recipe.image, queryData.hits[i].recipe.url, i));
		}

		var recipeComponents = queryData.hits.map(function(hit) {
			return(
				<img src={hit.image} alt={hit.label}/>
			)
		})
	}

	/*
	if(queryData) {
		for(let i = 0; i < queryData.hits.length; i++) {
			recipes.push(queryData.hits[i].recipe.image);
		}

		var recipeComponents = recipes.map(function(image) {
			return (<img src={image} rounded/>);
		})
	}*/

	return (
		<div>
			{recipeComponents}
		</div>
	)
}

export default RecipeDisplay;
